
import re

dict={}

for id in range(0,2001):
    if id ==981:
        continue
    code=open(f'./SCTF/C{id}.java', 'rt').read()
    lines=open(f'./SCTF/C{id}.java', 'rt').readlines()

    func=re.findall(r"""next \= new (C[0-9A-Z]*)\(\)""", code)
    
    
    NOPE=[]
    for i in range(len(lines)):
        if "throw new Exception(\"Nope!\")" in lines[i]:
            li=re.findall(r"""public void (.*)\(StringBuilder code\)""", lines[i-1])
            NOPE.append(f'{li[0]}_nope')

    here_code=re.findall(r"""(?<!next\.)(mo.*)\(code\)""",code)
    next_code=re.findall(r"""(next\.mo.*)\(code\)""",code)
    dict[f'C{id}']=[func, NOPE, here_code, next_code]


self_nope=[]
for i in dict:
    nopes=dict[i][1]
  
    for j in nopes:
        no=j.replace('_nope', '')
        if no in dict[i][2]:
            self_nope.append(i)
            break

next_nope=[]
for li in dict:
    test=dict[li]
    next_func=test[0]
    func_of=test[3]

    for i in next_func:
        nope=dict[i][1]
        for j in nope:
            j=j.replace('_nope','')
            j='next.'+j
            if j in func_of:
                next_nope.append([li, i])
                break


for i in dict:
    new_func=[]
    func=dict[i][0]
    for j in func:
        
        if j not in self_nope:
            new_func.append(j)
    dict[i][0]=new_func


for i in next_nope:
    func=dict[i[0]][0]
    
    new_func=[]
    for j in func:
        if j!=i[1]:
            new_func.append(j)
    dict[i[0]][0]=new_func

